import React from "react";
import { connect } from "react-redux";
import classNames from "classnames";
import { setActiveComponent, restart } from "../actions";
import Histogram from "./Histogram";

// show the number of questions asked and the favourite car/remaining cars.
function Result({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  restart,
  scores
}) {
  let ths = [];
  attributes.forEach(([attr, config]) => {
    if (mask[attr]) {
      const th = <th key={attr}>{attr}</th>;
      ths.push(th);
    }
  });
  ths.push(<th key="chooseButton" />)

  const trs = leftPoints.map((idx, i) => (
    <tr key={i} data-toggle="tooltip" title={labels[idx]}>
      {candidates[idx].map((x, j) => (
        <td key={j}>{x}</td>
      ))}
    </tr>
  ));

  const trswithbox = leftPoints.map((idx, i) => (
      <tr key={i} data-toggle="tooltip" title={labels[idx]}>
        {candidates[idx].map((x, j) => (
            <td key={j}>{x}</td>
        ))}
        <td>
          <input type="checkbox" id={`myCheckbox${i}`} name={`myCheckbox${i}`} value="myValue" />
          <label htmlFor={`myCheckbox${i}`}>Check me</label>
        </td>
      </tr>
  ));


  const sss = scores.map((sid, i) => (
      <tr key={i} data-toggle="tooltip" title={labels[i]}>
        <td key={i}>{sid}</td>
      </tr>
  ));

  const top1 = [];
  for(let i = 0; i < 1; ++i)
      top1.push(trs[i]);
  const top1small = [];
  for(let i = 1; i < trs.length; ++i)
  {
    if((scores[0] - scores[i])/scores[0] < 0.1)
    {
      top1small.push(trs[i]);
      if(top1small.length > 0)
        break;
    }
  }


  const top5 = [];
  for(let i = 0; i < 5; ++i)
    top5.push(trs[i]);

  const top10 = [];
  for(let i = 0; i < 10; ++i)
    top10.push(trs[i]);

  return (
  <div>
    <div className="justify-content-center">
      <h4>
      Here is your favorite car.
      </h4>
      <table k={1}
        className={classNames("table", "table-hover", {
          "table-fixed": trs.length > 7
        })}
        style={{
          maxWidth: "40rem",
          margin: "auto"
        }}
      >
        <thead>
          <tr>{ths}</tr>
        </thead>
        <tbody>{top1}</tbody>
      </table>
      <h5>
        Please compare your favorite car and the following cars <br />
        and indicate if you are interested in the following cars?
      </h5>
      <table
             className={classNames("table", "table-hover", {
               "table-fixed": trs.length > 7
             })}
             style={{
               maxWidth: "50rem",
               margin: "auto"
             }}
      >
        <thead>
        <tr>{ths}</tr>
        </thead>
        <tbody>{top1small}</tbody>
      </table>
    </div>
    <br></br>

    <div className="justify-content-center">
      <h4>
        Here are your top-5 favorite cars.
      </h4>
      <table k={2}
        className={classNames("table", "table-hover", {
          "table-fixed": trs.length > 7
        })}
        style={{
          maxWidth: "40rem",
          margin: "auto"
        }}
    >
      <thead>
      <tr>{ths}</tr>
      </thead>
      <tbody>{top5}</tbody>
    </table>
    <h5>
      Please compare your top-5 favorite car and the following cars <br />
      and indicate if you are interested in the following cars?
    </h5>
    <tr >
      Car
    </tr>
    </div>
    <br></br>


    <div className="justify-content-center">
    <h4>
      Here are your top-10 favorite cars.
    </h4>
    <table k={3}
        className={classNames("table", "table-hover", {
          "table-fixed": trs.length > 7
        })}
        style={{
          maxWidth: "40rem",
          margin: "auto"
        }}
    >
      <thead>
      <tr>{ths}</tr>
      </thead>
      <tbody>{top10}</tbody>
      <h5>
        Please compare your top-10 favorite car and the following cars <br />
        and indicate if you are interested in the following cars?
      </h5>
    </table>
  </div>
  </div>
  );
}

const mapStateToProps = ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
}) => ({
  labels,
  candidates,
  leftPoints,
  attributes,
  mask,
  numLeftPoints,
  scores
});

const mapDispatchToProps = dispatch => ({
  restart: () => {
    dispatch(setActiveComponent("Welcome"));
    dispatch(restart());
  }
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Result);
